import React from "react";
import s from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      <div className="dialog-items">
        <div className="dialog">Viktor</div>
        <div className="dialog">Alex</div>
        <div className="dialog">John</div>
        <div className="dialog">Frank</div>
        <div className="dialog">Maxym</div>
      </div>
      <div className="messages">
        <div className="message">Hi</div>
        <div className="message">How are you doing today?</div>
        <div className="message">All good. How about you?</div>
      </div>
    </div>
  );
};

export default Dialogs;
